import React from 'react';

const Noticias = (props) => {
    return (
        <div className="row">
            {props.noticias.map(noticia =>{
                return(
                    <Noticia
                        noticia={noticia}
                    />
                );
            })}
        </div>
    );
};

export default Noticias;
